import React from 'react';
import Typed from "react-typed";

function Home() {
  return (
    <Typed
      strings={[
        "Front End Developer",
        "Back End Developer",
        "Software Engineer"
      ]}
      typeSpeed={80}
      backDelay={1100}
      backSpeed={30}
      loop
    />
  );
}

export default Home;
